import React, { Component, useState } from "react";
import "./Mainpage.css";
import logo from "./logo.png";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Button } from "bootstrap";
import Modal from "react-modal";

function MainPage() {
  const [isModalOpen, setIsModalOpen] = useState(0);
  return (
    <div className="main">
      <div onClick={() => setIsModalOpen(1)} className="btn-wrapper">
        <button className="btn">Sign up / Sign in</button>
      </div>
      <Modal
        isModalOpen={1}
        isOpen={isModalOpen}
        onRequestClose={() => setIsModalOpen(0)}
        className="kakaotalk-modal"
        closeTimeoutMS={200}
      >
        <img
          src="/images/kakaotalk-qrcode.png"
          alt="kakaotalk-qrcode"
          className="kakaotalk-modal-img"
        ></img>
      </Modal>
      <a href="/" className="logo">
        <img src={logo} className="logo-img" alt=""></img>
      </a>
    </div>
  );
}
export default MainPage;
